import { students } from "./data";

function App() {


  return (

    <>
      <div className="container">
        <div className="row">

          {
            students.map( (data,index )=> 

              <>
              <div className="col-md-3">
                <div className="card">
                  <div className="card-body">
                    <h2>{data.name}</h2>
                    <p>{data.age}</p>
                    <p>{data.skill}</p>
                  </div>
                </div>
              </div>
              <div className="box"></div>
              </>

              )
          }




        </div>
      </div>

    </>

  );
}

export default App;
